import React, { useState } from "react";
import styled from "styled-components"; // REQUIRED for SC
import Card from "./Card";
import "./EntryList.css";
const EntryList = (props) => {
  const profiles = [{ username: "Felix", age: 49 },{ username: "Jeremaih", age: 31 },{ username: "Dioda", age: 49 }]; //% Add usernames and ages to this in an obj literal
  return (
    <Card>
      <ul>
        {profiles.map((obj) => (
          <li>{obj.username} ({obj.age} years old)</li>
        ))}
      </ul>
    </Card>
  );
};
export default EntryList;
